import React from 'react';
import MapView from 'react-native-maps';
import { StyleSheet, View, Text } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import Ionicons from 'react-native-vector-icons/Iconicons';

const tab = createBottomTabNavigator();

function Carte() {
  <View style={styles.container}>
    <MapView style={styles.map} />
  </View>
}

function Parametres() {
  <View style={styles.container}>
    <Text>Paramètres !</Text>
  </View>
}

function Balises() {
  <View style={styles.container}>
    <Text>Balises !</Text>
  </View>
}

function navbar() {
  return(
    <NavigationContainer>
      <tab.Navigator screenOptions={ ({route}) => {
        tabBarIcon: ({focused,color,size}) => {
          let iconName;
          if (route.name == 'Carte') {
            iconName = "map-outline"
          } else if (route.name == 'Paramètres') {
            iconName = "settings-outline"
          }
          else if (route.name == 'Balises') {
            iconName = "location-outline"
          }
          return <Ionicons name={iconName} size={25} />
        }
      }}>
        <tab.Screen name='Balises' component={Balises} />
        <tab.Screen name='Carte' component={Carte} />
        <tab.Screen name='Paramètres' component={Parametres} />
      </tab.Navigator>
    </NavigationContainer>
  )
}

export default function App() {
  return (
  <View style={styles.container}>
    <Text>Balises !</Text>
  </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backroundcolor: '#fff',
    alignItems: 'center',
  },
  map: {
    width: '100%',
    height: '100%',
  },
});
